import type { OsmFeature } from "./features";
export type ChangesetComment = {
    id: number;
    visible: boolean;
    user: string;
    uid: string;
    date: Date;
    text: string;
};
export type Changeset = {
    id: number;
    created_at: Date;
    open: boolean;
    comments_count: number;
    changes_count: number;
    /** property only exists if `open=false` */
    closed_at: Date;
    /** property only exists if `open=false` */
    min_lat: number;
    /** property only exists if `open=false` */
    min_lon: number;
    /** property only exists if `open=false` */
    max_lat: number;
    /** property only exists if `open=false` */
    max_lon: number;
    uid: number;
    user: string;
    tags: {
        [key: string]: string;
    };
    /** the `discussion` attribute is only included in the `getChangeset` API */
    discussion?: ChangesetComment[];
};
export type OsmChange = {
    create: OsmFeature[];
    modify: OsmFeature[];
    delete: OsmFeature[];
};
